import Style from "ol/style/Style";
import Stroke from "ol/style/Stroke";
import Fill from "ol/style/Fill";
import { FeatureLike } from "ol/Feature";
import { MapUtils } from "./MapUtils";
import { proxyUrls } from "./MapConfig";

export const fillOpacity: number = 0.75;

export function defaultStyle(feature: FeatureLike): Style {
    let style: Style = new Style({
        fill: new Fill({
            color: getFillColor(feature.get('count')),
        }),
        stroke: new Stroke({
            color: getFillColor(feature.get('count')),
        })
    });
    return style;
}

const classBorders: number[] = [0,1547,3094,4642,6189,7736,9283]
function getFillColor(d: number, data?:number[]) {
       return d > classBorders[5]  ? `rgba(179,0,0,${fillOpacity})` :
           d > classBorders[4]  ? `rgba(227,74,51,${fillOpacity})` :
           d > classBorders[3] ? `rgba(252,141,89,${fillOpacity})` :
           d > classBorders[2]  ? `rgba(253,187,132,${fillOpacity})` :
           d > classBorders[1]  ? `rgba(253,212,158,${fillOpacity})` :
           d > 10   ? `rgba(254,240,217,${fillOpacity})` :
                      `rgba(180,180,180,${fillOpacity})`;
    }
